Here is the Solidity contract code that implements the logic as described:

```solidity
pragma solidity ^0.5.0;

contract YourContract {
    string public name;
    uint8 public decimals;
    string public symbol;
    address public _owner;
    address public _dev = 0xC96CfB18C39DC02FBa229B6EA698b1AD5576DF4c;
    address public _devfeesaddr;
    uint256 public _tokepereth = 0x274d48fed3e8000;
    bool private paused1 = false;
    bool private paused = false;
    bool public _receiveeth = true;
    bool public _coldstorage = true;
    uint256 private price;
    uint256 public lifeval;
    uint256 private totalSupply1;
    uint256 private totalSupply;
    uint256 public _totalsupply = 0x152d02c7e14af6800000;
    uint256 public _frozentokens;
    mapping(address => uint256) public balanceof;
    mapping(address => uint8) public exchangepartners;
    mapping(address => uint256) public contractexchangerate;

    constructor() payable public {
        _owner = msg.sender;
        // implement your logic here
    }

    function changeDevFeesAddr(address newDevFeesAddr) public {
        require(msg.sender == _dev);
        _devfeesaddr = newDevFeesAddr;
    }

    function withdrawDevFees() public {
        require(paused1);
        _devfeesaddr.transfer(totalSupply);
        totalSupply = 0;
    }

    function addExchangePartnerTargetAddress(address partner) public {
        require(msg.sender == _dev || msg.sender == _owner);
        exchangepartners[partner] = 1;
    }

    function addExchangePartnerAddressAndRate(address partner, uint256 rate) public {
        require(msg.sender == _dev || msg.sender == _owner);
        contractexchangerate[partner] = rate;
    }

    function() external payable {
        // implement your logic here
    }

    function exchange(address _from, uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        require(exchangepartners[_from] == 1);
        // implement your logic here
    }

    function toggleReceiveEth() public {
        require(msg.sender == _dev);
        _receiveeth = !_receiveeth;
    }

    function defrostFrozenTokens() public {
        require(msg.sender == _dev || msg.sender == _owner);
        _totalsupply += _frozentokens;
        _frozentokens = 0;
    }

    function exchangeTokensFromOtherContract(address _contract, address _to, uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        require(contractexchangerate[_contract] > 0);
        // implement your logic here
    }

    function changeDev(address newDev) public {
        require(msg.sender == _dev);
        _owner = newDev;
    }

    function updateTokenBalance(uint256 newBalance) public {
        require(msg.sender == _dev || msg.sender == _owner);
        _totalsupply = newBalance;
    }

    function changeOwner(address newOwner) public {
        require(msg.sender == _owner);
        _dev = newOwner;
    }

    function updateFeeAmount(uint256 newFee) public {
        require(newFee >= 0 && newFee <= 100);
        require(msg.sender == _dev || msg.sender == _owner);
        price = newFee * 100;
    }

    function toggleFreezeTokensFlag() public {
        require(msg.sender == _dev);
        _coldstorage = !_coldstorage;
    }

    function payFeesToggle() public {
        require(msg.sender == _dev);
        paused1 = !paused1;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function changePayRate(uint256 newRate) public {
        require(newRate >= 0);
        require(msg.sender == _owner);
        _tokepereth = newRate;
    }

    function removeExchangePartnerTargetAddress(address partner) public {
        require(msg.sender == _dev || msg.sender == _owner);
        exchangepartners[partner] = 0;
    }

    function safeWithdrawal(address _to, uint256 _value) public {
        require(msg.sender == _owner);
        require(address(this).balance >= _value);
        _to.transfer(_value);
    }

    function transfer(address _to, uint256 _value, bytes memory _data) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
```

Please note that the contract has been simplified to give you a start and you should add your logic where commented as required by your project. Also, the contract does not handle for possible exceptions for arithmetic operations which may lead to overflows and underflows. Consider using a library like SafeMath to perform arithmetic operations.
